// src/pages/CustomerBooth.js

import React from 'react';
import { Link } from 'react-router-dom';
import './CustomerBooth.css';

function CustomerBooth() {
    return (
        <div className="customer-booth">
            <h2>Welcome to the Customer Booth</h2>
            <div className="button-group">
                <Link to="/customer/login">
                    <button className="btn">Login</button>
                </Link>
                <Link to="/customer/register">
                    <button className="btn">Register / New Account</button>
                </Link>
            </div>
        </div>
    );
}

export default CustomerBooth;
